import React from 'react';
import logo from './logo.svg';
import './App.css';
//import axios from 'axios';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <button onClick={test}>Test</button>
      </header>
    </div>
  );
}

function test(){
  console.log("Test")
  fetch('http://localhost:3001/api/ping').then((x) => console.log("ping" + x.body));
  fetch('http://localhost:3001/api/open').then((x) => console.log("response:" + x.body));
}

export default App;
